    LOG ENTRIES (0x1eD3d2c916cab00631cce4b08a7F880d4Badae94) (UpgradePet(address indexed user, uint256 id, uint256 to)){
        EMIT XES EVENT ()(user)()("Haustier verbessern" as xs:string concept:name);
